        content: "";
        display: block;
        padding-bottom: 100%;
    }
`









const Main = () => {
    return (
        <div>
            <div class="box">
  <div class="row header">
    <p><b>header</b>
      <br />
      <br />(sized to content)</p>
  </div>
  <div class="row content">
    <p>
      <b>content</b>
      (fills remaining space)
    </p>
  </div>
  <div class="row footer">
    <p><b>footer</b> (fixed height)</p>
  </div>
</div>

        </div>
    )
}

export default Main
